import React from 'react';

const Plan = () => {
    return (
        <div
        style={{
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '90vh'
        }}
        >
        <h1>Plan</h1>
        </div>
    );
};

export default Plan;
